import { dataportfolio, meta } from "../../content_option";
import "./style.css"; // Make sure to import your styles here

export const Portfolio = () => {

  const settings = {
    className: "center",
    centerMode: true,
    infinite: true,
    centerPadding: "60px",
    slidesToShow: 3,
    speed: 500
